DROP TABLE tbarticulos;
CREATE TABLE tbarticulos (
  Codigo VARCHAR(20) DEFAULT 'SINCODIGO' NOT NULL,
  Rubro VARCHAR(25),
  Descripcion VARCHAR(50),
  Marca VARCHAR(20),
  PrecioVenta FLOAT,
  PrecioCompra FLOAT,
  StockMinimo FLOAT,
  Stock FLOAT,
  AlicuotaIva FLOAT,
  Deposito FLOAT,
  id AUTOINC,
  FechaCompra DATE,
  idProveedor INTEGER,
  Lista2 FLOAT,
  Lista3 FLOAT,
  Unidad VARCHAR(30),
  Lista4 FLOAT,
  PorcentajeGanancia FLOAT,
  Calculado LOGICAL DEFAULT false,
  CodigoProv VARCHAR(20),
  CostoPromedio FLOAT,
  CostoEnDolares LOGICAL DEFAULT false,
  FechaModif DATE,
  PrecioListaProveedor FLOAT,
  StockInicial FLOAT,
  Ubicacion VARCHAR(6),
  Lista1EnDolares LOGICAL DEFAULT false,
  Dto1 FLOAT,
  Dto2 FLOAT,
  Dto3 FLOAT,
  Impuesto FLOAT,
  EnPromocion LOGICAL DEFAULT false,
  UsaTalle LOGICAL DEFAULT false,
  Compuesto LOGICAL DEFAULT false,
  Combustible LOGICAL DEFAULT false,
  ImpuestoPorcentual LOGICAL, 
  INDEX Codigo (Codigo), 
  INDEX Descripcion (Descripcion), 
  INDEX Marca (Marca, Descripcion), 
  INDEX Rubro (Rubro), 
  INDEX CodigoProv (CodigoProv), 
  INDEX rubroDescrip (Rubro, Descripcion), 
  INDEX IdprovDescrip (idProveedor, Descripcion), 
  UNIQUE INDEX Id (id), 
  INDEX FModif (FechaModif DESC), 
  INDEX FCompra (FechaCompra DESC)
);

